            Assert.False(onePascalCubicMeterPerSecond > twoPascalCubicMetersPerSecond);
            Assert.False(onePascalCubicMeterPerSecond >= twoPascalCubicMetersPerSecond);
            Assert.False(twoPascalCubicMetersPerSecond < onePascalCubicMeterPerSecond);
            Assert.False(twoPascalCubicMetersPerSecond <= onePascalCubicMeterPerSecond);
        }

